import React from 'react';
import { Paper, Typography, Container } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    content: {
        marginBottom: '8px',
    },
    header: {
        marginTop: '8px',
        marginBottom: '0px',
    },
    container: {
        marginTop: '20px',
    }
  });

const StyledCard = ({ rocketName, type, details, location, launchDate }) => {

    const classes = useStyles();

    return (
        <React.Fragment>
            <Paper elevation={1}>
                <Container className={classes.container}>
                    <div className={classes.content}><h3 className={classes.header}>Rocket Name: {rocketName}</h3></div>
                    <div className={classes.content}><Typography color="textSecondary"><strong>Type: </strong>{type}</Typography></div>
                    <div className={classes.content}><strong>Details: </strong>{details}</div>
                    <div className={classes.content}><strong>Location: </strong>{location}</div>
                    <div className={classes.content}><strong>Launch Date: </strong>{launchDate}</div>
                </Container>
            </Paper>
        </React.Fragment>
    )
}

export default StyledCard;
